<?php

function assignFunction(): void
{
    $num = 1; // 5行目
    $num += 1; // 6行目
    $num -= 1; // 7行目
    $num *= 1; // 8行目
    $num /= 1; // 9行目
    $num %= 1; // 10行目
    $num **= 1; // 11行目
    $num &= 1; // 12行目
    $num |= 1; // 13行目
    $num ^= 1; // 14行目
    $num <<= 1; // 15行目
    $num >>= 1; // 16行目
    $num .= 1; // 17行目
    $num ??= 1; // 18行目
}